-------------THE DIG------------------
1995 adventure game by LUCAS ARTS

One of the best adventures i've ever
played, plus it works perfect under XP,
just mount the image and run DIG.EXE

The only problem that might occur is
during sound setup. Choose Express setup.
If it detects your sound card then its ok,
if it doesn't choose custom install and
enter the port and irq
Check if they
are displayed in the device manager. if not
use port=220,irq=5,DMA=1 (95% it will work).
If it doesn't change irq=7.

